      content: >-
        [head=2]Термоядерный Электрогенератор[/head]


        [head=2]Инженерная компания TB[/head]

        Спасибо за покупку вашего собственного Термоядерного Электрогенератора (ТЭГ) от инженерной компании TB. Многие новички сталкиваются с трудностями при освоении устройства, но не переживайте! Мы подготовили эту краткую инструкцию, чтобы помочь вам настроить базовый ТЭГ. Это не единственный способ настройки ТЭГ, но он один из самых простых.


        [head=2]Настройка[/head]

        [bold]Шаг 0:[/bold] Если вы используете ТЭГ впервые, инженерная компания TB настоятельно рекомендует подготовить вспомогательное решение для питания. ТЭГ может потребовать длительного времени настройки, и без дополнительной помощи это может быть сложно.

        [bold]Шаг 1:[/bold] Подключите насос [italic]"Выход в космический радиатор"[/italic] к юго-восточному порту ТЭГ, а насос [italic]"Вход радиатора космоса"[/italic] — к юго-западному порту ТЭГ. Это должно образовать петлю труб.

        [bold]Шаг 2:[/bold] Заполните петлю труб охлаждающей жидкостью. Хорошим выбором будет один баллон с водяным паром.

        [bold]Шаг 3:[/bold] Подключите насос [italic]"Атмос в ТЭГ"[/italic] к насосу [italic]"Вход камеры сгорания"[/italic].

        [bold]Шаг 4:[/bold] Подключите насос [italic]"Выход камеры сгорания"[/italic] к северо-западному порту ТЭГ, а насос [italic]"ТЭГ в космос"[/italic] — к северо-восточному порту ТЭГ.


        [head=2]Эксплуатация[/head]

        [bold]Шаг 6:[/bold] Включите все насосы, входящие в южный контур охлаждения, чтобы обеспечить циркуляцию охлаждающей жидкости.

        [bold]Шаг 5:[/bold] Подключите к ТЭГ смесь для горения из атмосферной системы через коричневую трубу. Убедитесь, что насосы работают, и используйте прилагаемый газоанализатор для проверки состава смеси. Мы рекомендуем смесь из 2% плазмы и 98% кислорода.

        [bold]Шаг 6:[/bold] Введите небольшое количество смеси для горения в камеру — достаточно, чтобы появилась фиолетовая окраска, — с помощью насоса [italic]"Вход в камеру сгорания"[/italic].

        [bold]Шаг 7:[/bold] Используйте кнопку "Воспламенить камеру", чтобы зажечь топливную смесь. Убедитесь, что камера успешно воспламенилась.

        [bold]Шаг 8:[/bold] Полностью включите насос [italic]"Вход камеры сгорания"[/italic]. Камера может прекратить горение при достижении достаточного давления — это нормально.

        [bold]Шаг 9:[/bold] Полностью включите насос [italic]"ТЭГ в космос"[/italic] и частично включите насос [italic]"Выход камеры сгорания"[/italic], ограничив поток до 30 л/с.


        [head=3]Устранение неисправностей[/head]


        [bold]Циркуляторы не работают:[/bold] Циркуляторы направленные. Убедитесь, что газ течет по часовой стрелке. В комплекте должны быть насосы, указывающие направление потока.

        [bold]Камера сгорания не горит:[/bold] Если камера все еще горячая, это нормально и происходит, когда давление в камере достигает необходимого уровня, и топливо больше не подается. В противном случае убедитесь, что топливная смесь корректна. При холодном старте избегайте подачи слишком большого количества топлива, чтобы не залить камеру.

        [bold]Недостаточно энергии для работы ТЭГ:[/bold] Используйте любые доступные вторичные источники питания для оборудования, чтобы запустить ТЭГ При необходимости отключите вспомогательные подключения питания, чтобы обеспечить правильное питание TEG для запуска.

        [bold]Произошла утечка газа в помещении ТЭГ:[/bold] Используйте аварийные вентиляционные заслонки для удаления газа из помещения. Убедитесь, что вы используете подходящие средства защиты во время выполнения этой процедуры. Операцию можно выполнить из камеры ТЭГ или комнаты управления ТЭГ.

        [bold]Моя команда некомпетентна:[/bold] Пожалуйста, верните свою команду производителю как можно скорее и закажите новую. Возвраты могут быть оформлены в соответствии с гарантией производителя. Инженерная компания TB не несет ответственности за травмы, финансовые потери, потери станции, потерю мозговых клеток, потерю жизни или мигрени, вызванные попыткой эксплуатации ТЭГ с неисправной командой.
