        [head=1]Автономный исследовательский модуль класса "Intrepid"[/head]

        [head=2]Инженерная фирма TB[/head]


        Спасибо за покупку собственного автономного исследовательского модуля класса Intrepid! Мы здесь, в TB Engineering, сделали все возможное, чтобы эта автономная лаборатория обслуживала все ваши потребности в исследованиях и прототипировании.


        Передняя часть модуля включает в себя главную лабораторию, которую можно модернизировать для различных целей, таких как ксенобиология, ксеноархеология, чистые помещения, анализ материалов и многое другое! Спросите нас о различных доступных вариантах, поскольку мы гарантируем, что у нас есть один для ваших целей. Если нет, то индивидуальные переоборудования доступны по более высокой цене.


